import React, { useEffect, useRef, useState } from 'react';
import './LoadUpPage.css';

const LoadUpPage = ({ onVideoEnd }) => {
    const videoRef = useRef(null);
    const [showButton, setShowButton] = useState(false);

    useEffect(() => {
        const video = videoRef.current;

        // Function to adjust the playback rate
        const adjustPlaybackRate = () => {
            if (video) {
                const duration = video.duration;
                const currentTime = video.currentTime;

                // Adjust playback rate based on the current time
                if (currentTime >= duration / 3 && currentTime < (2 * duration) / 3) {
                    video.playbackRate = 1.3; // Speed up the middle part
                } else {
                    video.playbackRate = 1; // Normal speed
                }
            }
        };

        const handleVideoEnd = () => {
            setShowButton(true);
        };

        const resetVideo = () => {
            if (video) {
                video.currentTime = 0;
                video.play().catch(error => {
                    console.error("Video playback error:", error);
                });
            }
        };

        // Reset video on mount
        resetVideo();

        // Add event listeners
        if (video) {
            video.addEventListener('timeupdate', adjustPlaybackRate);
            video.addEventListener('ended', handleVideoEnd);
        }

        return () => {
            // Clean up event listeners
            if (video) {
                video.removeEventListener('timeupdate', adjustPlaybackRate);
                video.removeEventListener('ended', handleVideoEnd);
            }
        };
    }, []);

    return (
        <div className="intro-video-container">
            <video
                ref={videoRef}
                src="/StartUpScreen.mov"
                autoPlay
                muted
                className="intro-video"
            />
            {showButton && (
                <button className="enter-button" onClick={onVideoEnd}>
                    Elevate your Finance
                </button>
            )}
        </div>
    );
};

export default LoadUpPage;
